import React, { useEffect, useState } from "react";
import API from "../../utils/API"





function Setlist() {

    const [setlists, setSetlists] = useState([{}]);

    useEffect(() => {
        getSetlists();
    });

    function getSetlists() {
        API.getSetlists()
            .then(res => {
                setSetlists([{ res }])
            }).catch(err => {
                console.log(err)
            })
    }

    return (
        <>
            {
                setlists.map(setlist => {
                    return <li key="_id" className="list-group-item">
                        <strong>
                            Name: {this.setlist.name} Gig Type: {this.setlist.gigtype}
                        </strong>
                    </li>
                })
            }
        </>
    )
}

export default Setlist;
